import "./App.css";

function App() {
  return (
    <div>
      <header>
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fpl.wikipedia.org%2Fwiki%2FLogo&psig=AOvVaw1LZ6AvbUYEh9KOseDogqRo&ust=1670866826054000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCKCRko6O8vsCFQAAAAAdAAAAABAE" />
      </header>
    </div>
  );
}

export default App;
